/* eslint-disable jsx-a11y/anchor-is-valid */
import './service.css'
import React from 'react'

export default function Service(props) {
    return (
        <div className='service active'>
            <a className='service__title'>{props.title}</a>

            <div className='service__span-container'>
            <p className='service__subtitle-1'>
                {props.subtitle1}
            </p> <br/>
            <p className='service__subtitle-2'>
                {props.subtitle2}
            </p>
            </div>
            
        </div>
    )
}
